import React from 'react';
import './Navbar.css';
const Navbar = () => {
    return (
        <div>
          <ul>
              <li>Logo</li>
              <li style={rightNav}>Home</li>
              <li>Movie</li>
              <li>FAQ</li>
        </ul>   
        </div>
    )
}
const rightNav={
    float: 'right'
}
export default Navbar
